import React, { useEffect, useState } from "react";


const Register = () => {
  const [data, setdata] = useState({
    email: "",
    password: "",
    fullname: "",
    dateOfBirth: "",
    gender: "",
    country: [],
    recieveNewsLetters: "",
  });
  const [countries, setcountries] = ueState([
    { id: 0, countryname: "India" },
    { id: 0, countryname: "French" },
    { id: 0, countryname: "Bhutan" },
    { id: 0, countryname: "Germany" },
  ]);
  // const mycountry = countries.map((country,index)=>{
  //       return <option key={index} value='country'>{country}</option>
  //     })
const yourcountry = countries.map((countryname,id)=>{
  return <option key = {index} value='country'>{country}</option>
})



  useEffect(() => {
    document.title = "register";
  }, []);

  return (
    <div className="row">
      <div className="col-md-7 col-lg-6 mx-auto">
        <div className="card border-primary my-3">
          <div className="card-header border-bottom border-primary">
            <h3 className="text-center text-primary "> Register YourSelf</h3>
          </div>
          <div className="card-body border-bottom border-success">
            {/* Email start */}
            <div className="from-group form-row">
              <label htmlFor="email" className="col-lg-4">
                E-mail
              </label>
              <input
                type="text"
                name=""
                id="email"
                value={data.email}
                onChange={(e) => {
                  setstate({ ...data, [e.target.name]: e.target.value });
                }}
              />
              {/* Email end */}
              {/* Email start */}
              <div className="from-group form-row">
                <label htmlFor="email" className="col-lg-4">
                  E-mail
                </label>
                <input
                  type="text"
                  name=""
                  id="email"
                  value={data.email}
                  onChange={(e) => {
                    setstate({ ...data, [e.target.name]: e.target.value });
                  }}
                />
              </div>
              {/* Email end */}

              {/* password start */}
              <div className="from-group form-row">
                <label htmlFor="password" className="col-lg-4">
                  E-mail
                </label>
                <input
                  type="text"
                  name=""
                  id="password"
                  value={data.password}
                  onChange={(e) => {
                    setstate({ ...data, [e.target.name]: e.target.value });
                  }}
                />
              </div>
              {/* password end */}

              {/* fullname start */}
              <div className="from-group form-row">
                <label htmlFor="fullname" className="col-lg-4">
                  E-mail
                </label>
                <input
                  type="text"
                  name=""
                  id="fullname"
                  value={data.fullname}
                  onChange={(e) => {
                    setstate({ ...data, [e.target.name]: e.target.value });
                  }}
                />
              </div>
              {/* fullname end */}
               {/* dob start */}
               <div className="from-group form-row">
                <label htmlFor="dateOfBirth" className="col-lg-4">
                  Date of Birth
                </label>
                <input
                  type="date"
                  name="dateOfBirth"
                  id="dateOfBirth"
                  value={data.dateOfBirth}
                  onChange={(e) => {
                    setdata({ ...data, [e.target.name]: e.target.value });
                  }}
                />
              </div>
                {/* dob end */}
                 {/* gender start */}
               <div className="from-group form-row">
                <label htmlFor="gender" className="col-lg-4">
                  Gender
                </label>
                <select
                  type="date"
                  name="gender"
                  id="gender"
                  value={data.gender}
                  onChange={(e) => {
                    setdata({ ...data, [e.target.name]: e.target.value });
                  }}
                >{yourcountry}</select>

              </div>
                {/* gender end */}

                {/* newsletter start */}

 <div className="form-group form-row">
               <label htmlFor="newsletter" className="col-lg-4">
                 Newsletter
               </label>
              
               <div className="col-lg-6">
                <div className="form-check">
                 <input type="checkbox" name="recieveNewsLetters" id="recieveNewsLetters"
                className = 'form-check-input'
                value='true'
                checked= {data.recieveNewsLetters === true ? true:false}
                onChange={(e)=>{setdata({...data,[e.target.name]:e.target.checked})}}
                />
                <label htmlFor="newsletters" className="form-check-inline" >Recieve</label>
               </div>
              </div>
            </div>

{/* newsletter end */}

            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
